import React from "react";
import weekndImage from "./Images/weekndbg2.jpeg"
const AboutMe = () => {
    return (
        <>
            <div className="container text-center about rounded-2 p-5 my-5 w-100">
            <figure class="figure">
                <img src={weekndImage} class="figure-img img-fluid rounded" alt="A generic square placeholder image with rounded corners in a figure." />
                <figcaption class="figure-caption">A caption for the above image.</figcaption>
                </figure>
            </div>
        </>
    )
}

export default AboutMe
